import React from 'react';
import { VisibilityFilters } from '../actions';
import FilterContainer from '../containers/FilterContainer';

const Filters = () => (
  <div>
    <span>Show: </span>
    <FilterContainer filter={VisibilityFilters.SHOW_ALL}>All</FilterContainer>
    <FilterContainer filter={VisibilityFilters.NECKLACES_ONLY}>Collar Me Beautiful</FilterContainer>
    <FilterContainer filter={VisibilityFilters.BRACELETS_ONLY}>Wrist Action</FilterContainer>
    <FilterContainer filter={VisibilityFilters.EARRINGS_ONLY}>Lobe Trotters</FilterContainer>
  </div>
);

export default Filters;
